import React from "react";
import "../Styles/header.css";

function Header() {
  return (
    <>
      <div className="header">
        <div className="title">Table Question Answering Model</div>
        <ul class="navbar-nav me-auto mb-2 mb-lg-0" className="navbar">
          <li class="nav-item">

          </li>
        </ul>
      </div>
    </>
  );
}

export default Header;
